The device, which is a small circular platform with an electric drive, allows athletes to train the vestibular system rotating on the simulator platform.

Unique simulator/app features:
• Display of current speed, maximum limit;
• Notification of reaching the set speed to start twisting;
• Detection of the moment of the beginning of twisting with the subsequent release of rotation; • Notification of the achievement of a predetermined number of revolutions;
• The "Auto-trainer" function The simulator automatically increases the speed and speed according to a given program, optionally, changing the direction of movement;
• Graph of current speed to assess acceleration during twisting;
• Auto start - the beginning of rotation at a set speed with a sharp turn of the disk;
• Hitchhiking - stopping rotation when jumping from the simulator;
• Setting the dynamics of rotation of the simulator: acceleration, response speed.
• Video recording of training with all the numerical indicators.


Attention: classes should be carried out only under the supervision and control of an experienced instructor.

* The appearance and functionality of the simulator may differ from that presented - the manufacturer reserves the right to continuously improve the device and actively uses this right.

